import React from 'react';

const SearchBar = ({ searchTerm, setSearchTerm }) => {
    return (
        <div className="mb-12">
            <input
                type="text"
                placeholder="Search for books..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="p-3 w-1/2 rounded-lg bg-gray-700 text-white shadow-lg focus:outline-none focus:ring-2 focus:ring-primary"
            />
        </div>
    );
};

export default SearchBar;
